import React, { Component } from 'react';
import { Form, InputGroup, Button } from 'react-bootstrap';
var DatePicker = require("react-bootstrap-date-picker");

class Search extends Component {
  constructor(props) {
    super(props);
    this.state = {};

    this.handleYearChange = this.handleYearChange.bind(this);
    this.handlePriceChange = this.handlePriceChange.bind(this);
    this.handleDepositChange = this.handleDepositChange.bind(this);
    this.handleDateChange = this.handleDateChange.bind(this);
   }

  handleYearChange = (evt) => this.setState({ year: evt.target.value });
  handlePriceChange = (evt) => this.setState({ price: evt.target.value });
  handleDepositChange = (evt) => this.setState({ deposit: evt.target.value });
  handleDateChange = (evt) => this.setState({ date: evt.target.value });

  render() {
    console.log(this.state);
    return (
      <div className="search">
        <Form>
          <Form.Group>
            <Form.Label>Years</Form.Label>
            <Form.Control as="select" 
              onChange={this.handleYearChange}>
              <option value="1">1</option>
              <option value="2">2</option>
              <option value="3">3</option>
            </Form.Control>
          </Form.Group>
          <Form.Group>
            <Form.Label>Price</Form.Label>
            <InputGroup>
              <InputGroup.Prepend>
                <InputGroup.Text>Â£</InputGroup.Text>
              </InputGroup.Prepend>
              <Form.Control
                type="integer"
                placeholder="Username"
                aria-describedby="inputGroupPrepend"
                required
                onChange={this.handlePriceChange}
              />
            </InputGroup>
          </Form.Group>

          <Form.Group controlId="formBasicPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
          <Form.Group controlId="formBasicChecbox">
            <Form.Check type="checkbox" label="Check me out" />
          </Form.Group>
          <Button variant="primary" type="submit">
            Submit
          </Button>
        </Form>
      </div>
    );
  }
}

export default Search;
